import React from 'react'

function ToggleButton({title,setActiveProject}) {

  const handleClick = () => {
    if(title === 'Back-End'){
      setActiveProject(0)
    }else{
      setActiveProject(1)
    }
  }


  return (
    <div className='toggle-project-title'>
        {title}
    </div>
  )
}

export default ToggleButton
